import './App.css';
import Faq from  './Faq';
import {Switch, Route} from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <Switch>
        <Route path='/' component={Faq} />
      </Switch>
    </div>
  );
}

export default App;
